<template>
  <div class="container">
    <div class="mb-5">
      <h1 class="card-title font-weight-bold">
        Basil Classification
      </h1>
    </div>
    <div class="component card mb-3">
      <img
        :src="imageData"
        v-if="imageData.length > 0"
        class="card-img-top"
        alt="selected image"
      />
      <div class="card-body">
        <h5 class="card-title">
          Please select desire image that you want to predict. What type basil
          is it?
        </h5>
        <!-- <input type="file" @change="previewImage" accept="image/*" /> -->
        <button
          type="button"
          class="btn btn-outline-primary mt-3"
          @click="selectImage()"
        >
          Select Image
        </button>
      </div>
      <button
        id="myBtn"
        type="button"
        class="btn btn-outline-success m-3"
        v-if="imageData.length > 0"
        @click="predict()"
      >
        Predict
      </button>
    </div>
    <input
      type="file"
      class="hidden-input"
      id="input"
      @change="previewImage"
      accept="image/*"
    />


    <div class="alert alert-warning alert-dismissible fade show" role="alert" v-if="imageFile == ' '">
      <strong>Holy guacamole!</strong> You should check in on some of those
      fields below.
      <button
        type="button"
        class="close"
        data-dismiss="alert"
        aria-label="Close"
      >
        <span aria-hidden="true">&times;</span>
      </button>
    </div>
  </div>
</template>

<script>
import axios from "axios";
export default {
  name: "HelloWorld",
  props: {
    msg: String,
  },

  data() {
    return {
      imageData:
        "data:image/jpeg;base64,",
      imageFile: "a",
      status: "",
    };
  },
  methods: {
    selectImage: function() {
      var input = document.getElementById("input");
      input.click();
    },
    previewImage: function(event) {
      // Reference to the DOM input element
      var input = event.target;
      this.imageFile = input.files[0];
      // Ensure that you have a file before attempting to read it
      if (input.files && input.files[0]) {
        // create a new FileReader to read this image and convert to base64 format
        var reader = new FileReader();
        // Define a callback function to run, when FileReader finishes its job
        reader.onload = (e) => {
          // Note: arrow function used here, so that "this.imageData" refers to the imageData of Vue component
          // Read image as base64 and set to imageData
          this.imageData = e.target.result;
        };
        // Start the reader job - read file as a data url (base64 format)
        reader.readAsDataURL(input.files[0]);
      }
    },
    predict: function() {
        this.imageFile = " "
        var bodyFormData = new FormData();
        bodyFormData.append("image", this.imageFile);

        axios({
          method: "post",
          url: "http://127.0.0.1:5000/prediction/vgg16",
          data: bodyFormData,
          headers: { "Access-Control-Allow-Origin": "*" },
        })
          .then(function(response) {
            //handle success
            console.log(response);
          })
          .catch(function(response) {
            //handle error
            console.log(response);
          });


    },
  },
};


</script>

